/* SPDX-License-Identifier: MIT */
pragma solidity =0.8.10;

/* Package Imports */
import {PRBMathUD60x18} from "@hifi-finance/prb-math/contracts/PRBMathUD60x18.sol";
import {SafeERC20} from "@openzeppelin/contracts/token/ERC20/utils/SafeERC20.sol";

/* Package Interface Imports */
import {IERC20} from "@openzeppelin/contracts/token/ERC20/IERC20.sol";

/* Internal Imports */
import {PhantomStorageMixin} from "../../mixins/PhantomStorageMixin.sol";

/* Internal Interface Imports */
import {IPhantomERC20} from "../../../interfaces/core/erc20/IPhantomERC20.sol";
import {IPhantomTreasury} from "../../../interfaces/core/IPhantomTreasury.sol";
import {IPhantomAllocator} from "../../../interfaces/level0/finance/IPhantomAllocator.sol";

import {ISpiritSwapGauge} from "../../../interfaces/external/ISpiritSwapGauge.sol";
import {IyVault} from "../../../interfaces/external/IyVault.sol";

/**
 * @title PhantomAllocator
 * @author PhantomDao Team
 * @notice The contract responsible for holding all ERC20 assets
 */
contract PhantomAllocator is PhantomStorageMixin {
    using PRBMathUD60x18 for uint256;
    using SafeERC20 for IERC20;

    constructor(address storageFactoryAddress) PhantomStorageMixin(storageFactoryAddress) {
        return;
    }

    function allocateAssets() external {
        address token;
        uint256 balance;
        uint256 percentage;
        uint256 toSend;
        IyVault yearnVault;
        address[] memory destinations;
        address[] memory lpTokens = getLPTokens();
        address[] memory singleTokens = getSingleTokens();

        for (uint256 i = 0; i < lpTokens.length; i += 1) {
            token = lpTokens[i];
            if (IERC20(token) != SpiritSwapGaugeFor(token).TOKEN()) revert("F");
            balance = IERC20(token).balanceOf(address(PhantomVault()));
            PhantomTreasury().swap(
                address(this),
                0,
                address(0),
                balance,
                address(token),
                standardAccountKeys(),
                standardAccountPercentages()
            );
            SpiritSwapGaugeFor(token).deposit(balance);
            // Check to see if we have some rewards we can pull
            SpiritSwapGaugeFor(token).withdrawAll();
            // if redacted: spirit -> liquidate to RFV tokens (DAI, MIM, gOHM) -> re go to yearn
            // if not redacted: 50: take spirit -> inSpirit -> store and use for emissions voting, 50: if redacted
            balance = inSpiritToken().balanceOf(address(this));
            PhantomTreasury().swap(
                address(this),
                balance,
                address(inSpiritToken()),
                0,
                address(0),
                standardAccountKeys(),
                standardAccountPercentages()
            );
        }
    }

    function getLPTokens() internal view returns (address[] memory) {
        return PhantomStorage().getAddressArray(keccak256(abi.encodePacked(phantom.allocator.tokens.lp)));
    }

    function getSingleTokens() internal view returns (address[] memory) {
        return PhantomStorage().getAddressArray(keccak256(abi.encodePacked(phantom.allocator.tokens.single)));
    }

    function getPercentageForTokenWithDestination(address inToken, address inDestination)
        internal
        view
        returns (uint256)
    {
        return
            PhantomStorage().getUint(
                keccak256(abi.encodePacked(phantom.allocator.tokens.dest_percentage, inToken, inDestination))
            );
    }

    function getDestinationsFor(address inToken) internal view returns (address[] memory) {
        return
            PhantomStorage().getAddressArray(
                keccak256(abi.encodePacked(phantom.allocator.tokens.destinations, inToken))
            );
    }

    function SpiritSwapGaugeFor(address inToken) internal view returns (ISpiritSwapGauge) {
        return
            ISpiritSwapGauge(
                PhantomStorage().getAddress(keccak256(abi.encodePacked(phantom.routing.spirit_gauge_address, inToken)))
            );
    }

    function inSpiritToken() internal view returns (IERC20) {
        IERC20(PhantomStorage().getAddress(keccak256(phantom.allocator.tokens.addresses.spirit)));
    }
}
